INSERT INTO `noticiasprofesores` (`idNoticiaProfe`, `nombreNoticiaProfe`, `descripcionNoticiaProfe`, `fecha`) VALUES
(5, 'Taller de Estrategias Didácticas Innovadoras', 'La institución invita a todo el cuerpo docente a participar en un taller de estrategias didácticas para el aula del siglo XXI. En este espacio se abordarán técnicas creativas y herramientas prácticas para motivar a los estudiantes, integrando el aprendizaje colaborativo y el uso básico de tecnologías accesibles. Fecha: 25 de noviembre. Horario: 10:00 a 13:00. Lugar: Sala de Conferencias.', '2024-11-18 18:35:44'),
(6, 'Concurso Interno: “El Aula Creativa”', 'Se lanza un concurso dirigido a los profesores para diseñar propuestas innovadoras de actividades en el aula. Los proyectos ganadores serán implementados en el próximo ciclo lectivo y reconocidos con un certificado y un bono para material didáctico. Fecha límite de inscripción: 15 de diciembre. Premiación: Jornada Docente de cierre de año.\r\n\r\n', '2024-11-18 18:36:09'),
(7, 'Jornada de Reflexión Pedagógica', 'En el marco de la mejora continua, se organiza una jornada de reflexión pedagógica enfocada en los desafíos de la enseñanza post-pandemia. Se discutirán experiencias, se compartirán estrategias exitosas y se explorarán nuevos enfoques para fortalecer el vínculo entre docentes y estudiantes. Fecha: 5 de diciembre. Horario: 8:30 a 12:30.\r\n\r\n', '2024-11-18 18:36:23'),
(8, 'Actualización de Recursos para el Aula', 'La escuela ha adquirido nuevos recursos didácticos para apoyar a los profesores en sus clases, incluyendo sets de mapas interactivos, modelos anatómicos y kits de laboratorio. Estos materiales estarán disponibles en la biblioteca y pueden ser reservados para su uso a través del portal institucional.\r\n\r\n', '2024-11-18 18:36:38'),
(9, 'Reconocimiento al Profesorado Destacado', 'En la ceremonia de fin de año, la institución reconocerá a docentes destacados por su compromiso y creatividad en la enseñanza. Los seleccionados serán elegidos por sus colegas y estudiantes a través de una votación anónima. Plazo para votar: del 20 al 30 de noviembre.\r\n\r\n', '2024-11-18 18:36:53');

