INSERT INTO `novedades` (`idNovedad`, `novedad`, `descripcion`, `descripcionLarga`, `fecha`) VALUES
(5, 'Feria de Innovación Técnica 2024', 'La Escuela se prepara para la Feria de Innovación Tecnica 2024', 'La Escuela Técnica Nº 5 se prepara para la Feria de Innovación Técnica 2024, un evento que tendrá lugar el próximo sábado 7 de diciembre, donde los estudiantes exhibirán sus proyectos más destacados. Desde energías renovables hasta soluciones para la vida cotidiana, esta feria promete ser un espacio para compartir ideas, aprender y sorprenderse.\r\n\r\nHabrá talleres interactivos, demostraciones en vivo y un concurso de ideas innovadoras con premios para los mejores proyectos. La entrada es libre y abierta a toda la comunidad. ¡No te lo pierdas!\r\n\r\n', '2024-11-16 23:44:39'),
(7, 'Hackathon Escolar: Creando Soluciones con Tecnologia', 'La Escuela lanza el desafío del año: el Hackathon Escolar 2024', 'La Escuela Técnica Nº 5 lanza el desafío del año: el Hackathon Escolar 2024, que se realizará el próximo 18 de noviembre. Este evento reunirá a equipos de estudiantes para resolver problemáticas reales a través de la tecnología en solo 12 horas.\r\n\r\nEl hackathon busca fomentar la creatividad, el trabajo en equipo y las habilidades técnicas. Los equipos ganadores recibirán premios y la oportunidad de presentar sus ideas ante empresas locales. ¡Es el momento de demostrar lo que somos capaces de crear!', '2024-11-16 23:46:23'),
(8, 'Día de Puertas Abiertas: Conocé la Técnica Desde Adentro', 'El próximo 25 de noviembre, la Escuela abre sus puertas', 'El próximo 25 de noviembre, la Escuela Técnica Nº 5 abre sus puertas a toda la comunidad con el objetivo de mostrar el trabajo y compromiso de estudiantes y docentes. Durante el Día de Puertas Abiertas, los asistentes podrán recorrer los talleres, experimentar con herramientas técnicas y conversar con alumnos sobre su experiencia educativa.\r\n\r\nTambién habrá exposiciones, actividades prácticas y un stand informativo sobre las especialidades que se ofrecen. ¡Sumate a esta experiencia única y descubrí el mundo de la educación técnica!', '2024-11-16 23:46:51'),
(9, 'Expo Técnica 2024: Innovación en Acción', 'La Escuela Técnica Nº 5 invita a toda la comunidad a la Expo Técnica 2024', 'La Escuela Técnica Nº 5 invita a toda la comunidad a la Expo Técnica 2024, que se llevará a cabo el próximo 30 de noviembre en el auditorio del colegio. Este evento destacará los proyectos más creativos e innovadores desarrollados por nuestros estudiantes en áreas como robótica, electrónica, programación y diseño industrial.\r\n\r\nLa jornada incluirá presentaciones en vivo, talleres abiertos para el público y un panel de expertos que compartirán su visión sobre el futuro de las tecnologías. ¡No te pierdas esta oportunidad de conocer el talento técnico de nuestra región!\r\n\r\n', '2024-11-17 00:13:46'),
(10, 'Festival de Tecnología y Sustentabilidad', 'El 3 de diciembre, la Escuela realizará el Festival de Tecnología y Sustentabilidad', 'El próximo 3 de diciembre, la Escuela Técnica Nº 5 realizará el Festival de Tecnología y Sustentabilidad, un evento enfocado en promover la conciencia ambiental a través de la innovación técnica. Durante el festival, los estudiantes presentarán proyectos relacionados con energías renovables, reciclaje y soluciones para un futuro sostenible.\r\n\r\nAdemás, habrá actividades prácticas como la construcción de mini paneles solares, talleres de compostaje y charlas sobre el impacto de la tecnología en el medio ambiente. ¡Vení a aprender, inspirarte y sumarte al cambio!\r\n\r\n', '2024-11-17 00:14:17');

