INSERT INTO `proyectos` (`idProyecto`, `proyectoNombre`, `descripcionProyecto`, `carrera`, `cursos`, `archivo`, `nombreArchivo`, `srcVideo`) VALUES
(25, 'Robot Araña', 'El Robot Araña Autónomo es un prototipo diseñado para replicar los movimientos y capacidades de desplazamiento de un arácnido, utilizando sistemas robóticos avanzados. Este robot cuenta con ocho patas articuladas controladas de forma independiente mediante servomotores, lo que le permite caminar, girar y superar obstáculos con agilidad.', 'Programacion', '6to y 7mo 2da 2023', , 'Descripcion_Casos_de_Uso_Sistema_Bodega.docx', 'https://www.youtube.com/embed/GptT62bnOdk?si=O4ac7Wew758K9lvB');
INSERT INTO `proyectos` (`idProyecto`, `proyectoNombre`, `descripcionProyecto`, `carrera`, `cursos`, `archivo`, `nombreArchivo`, `srcVideo`) VALUES
(26, 'Auto Ring', 'El Auto Ring es un sistema automatizado diseñado para gestionar los horarios escolares mediante la activación de un timbre electrónico. Este proyecto busca reemplazar los métodos manuales de activación del timbre, garantizando precisión, facilidad de uso y adaptabilidad a diferentes horarios.', 'Informatica', '7mo 1ra 2024', , 'Descripcion_Casos_de_Uso_Sistema_Bodega.docx', 'https://www.youtube.com/embed/GptT62bnOdk?si=O4ac7Wew758K9lvB');
INSERT INTO `proyectos` (`idProyecto`, `proyectoNombre`, `descripcionProyecto`, `carrera`, `cursos`, `archivo`, `nombreArchivo`, `srcVideo`) VALUES
(27, 'Maqueta de la Huerta', 'La maqueta de una Huerta Sustentable es un modelo educativo diseñado para representar un sistema de cultivo autosuficiente y ecológico. Este proyecto combina conceptos de agricultura, sostenibilidad y tecnología, mostrando cómo se puede optimizar el espacio y los recursos para producir alimentos frescos en cualquier lugar.', 'Maestro Mayor de Obras', '7mo 3ra ', , 'Descripcion_Casos_de_Uso_Sistema_Bodega.docx', 'https://www.youtube.com/embed/GptT62bnOdk?si=O4ac7Wew758K9lvB');
INSERT INTO `proyectos` (`idProyecto`, `proyectoNombre`, `descripcionProyecto`, `carrera`, `cursos`, `archivo`, `nombreArchivo`, `srcVideo`) VALUES
(28, 'Casa con Domotica', 'La maqueta de una Casa Inteligente con Domótica es una representación en miniatura de un hogar automatizado, donde diferentes dispositivos y sistemas están interconectados para ofrecer comodidad, eficiencia energética y seguridad. Este proyecto combina tecnología y creatividad para mostrar cómo se pueden integrar sensores y actuadores en un entorno doméstico.', 'Basico', '3ro 2da 2024', , 'TP 19_ Marca de un negocio.docx', 'https://www.youtube.com/embed/GptT62bnOdk?si=O4ac7Wew758K9lvB');
INSERT INTO `proyectos` (`idProyecto`, `proyectoNombre`, `descripcionProyecto`, `carrera`, `cursos`, `archivo`, `nombreArchivo`, `srcVideo`) VALUES
(29, 'Apolo', 'Apolo es un robot humanoide diseñado para simular movimientos y tareas humanas básicas, combinando mecánica avanzada, programación y diseño estético. Este proyecto busca explorar las capacidades de la robótica en entornos educativos y experimentales, destacando su potencial en la interacción humano-máquina.', 'Programacion', '6to y 7mo 2da 2023', , 'Descripcion_Casos_de_Uso_Sistema_Bodega.docx', 'https://www.youtube.com/embed/GptT62bnOdk?si=O4ac7Wew758K9lvB');
INSERT INTO `proyectos` (`idProyecto`, `proyectoNombre`, `descripcionProyecto`, `carrera`, `cursos`, `archivo`, `nombreArchivo`, `srcVideo`) VALUES
(30, 'Gusty Love', 'Gusty Love es un vehículo autónomo diseñado para participar en competencias de sumo y superar pistas de obstáculos. Su diseño compacto, resistente y altamente personalizable combina sensores, motores y algoritmos avanzados para cumplir con los desafíos de empujar rivales fuera de un ring y atravesar circuitos con precisión.', 'Programacion', '7mo 2da 2024', , 'Descripcion_Casos_de_Uso_Sistema_Bodega.docx', 'https://www.youtube.com/embed/GptT62bnOdk?si=O4ac7Wew758K9lvB');
INSERT INTO `proyectos` (`idProyecto`, `proyectoNombre`, `descripcionProyecto`, `carrera`, `cursos`, `archivo`, `nombreArchivo`, `srcVideo`) VALUES
(31, 'Gestión Escolar ', 'Este proyecto consiste en desarrollar un sistema informático que permita gestionar las operaciones clave de una institución educativa, como el registro de estudiantes, la asignación de materias, el control de asistencias y la generación de reportes. El sistema estará diseñado para ser accesible desde una interfaz web intuitiva y segura.', 'Informatica', '7mo 1ra 2024', , 'TP 19_ Marca de un negocio.docx', 'https://www.youtube.com/embed/GptT62bnOdk?si=O4ac7Wew758K9lvB');
INSERT INTO `proyectos` (`idProyecto`, `proyectoNombre`, `descripcionProyecto`, `carrera`, `cursos`, `archivo`, `nombreArchivo`, `srcVideo`) VALUES
(32, 'Chatbot Educativo', 'Este proyecto consiste en crear un chatbot que funcione como asistente virtual para estudiantes y profesores, ayudándolos a resolver dudas relacionadas con el contenido educativo, horarios o trámites administrativos de la institución.', 'Informatica', '7mo 1ra 2024', , 'Descripcion_Casos_de_Uso_Sistema_Bodega.docx', 'https://www.youtube.com/embed/GptT62bnOdk?si=O4ac7Wew758K9lvB');
INSERT INTO `proyectos` (`idProyecto`, `proyectoNombre`, `descripcionProyecto`, `carrera`, `cursos`, `archivo`, `nombreArchivo`, `srcVideo`) VALUES
(33, 'Vivienda Sustentable', 'Este proyecto se enfoca en diseñar y construir una maqueta detallada de una vivienda sustentable, incorporando principios de arquitectura ecológica y eficiencia energética. La propuesta busca demostrar cómo integrar materiales sostenibles y sistemas de ahorro energético para reducir el impacto ambiental y los costos operativos de una vivienda.', 'Maestro Mayor de Obras', '7mo 3ra 2024', , 'TP 19_ Marca de un negocio.docx', 'https://www.youtube.com/embed/GptT62bnOdk?si=O4ac7Wew758K9lvB');
INSERT INTO `proyectos` (`idProyecto`, `proyectoNombre`, `descripcionProyecto`, `carrera`, `cursos`, `archivo`, `nombreArchivo`, `srcVideo`) VALUES
(34, 'Plaza Multifuncional', 'El proyecto plantea diseñar una plaza urbana que combine áreas recreativas, espacios verdes y zonas de servicios para fomentar la interacción comunitaria. Se busca incorporar criterios de accesibilidad universal, durabilidad de materiales y diseño paisajístico para un espacio moderno y funcional.\r\n', 'Maestro Mayor de Obras', '7mo 3ra 2024', , 'Descripcion_Casos_de_Uso_Sistema_Bodega.docx', 'https://www.youtube.com/embed/GptT62bnOdk?si=O4ac7Wew758K9lvB');
INSERT INTO `proyectos` (`idProyecto`, `proyectoNombre`, `descripcionProyecto`, `carrera`, `cursos`, `archivo`, `nombreArchivo`, `srcVideo`) VALUES
(35, 'Banco de Trabajo', 'Este proyecto consiste en construir un banco de trabajo multifuncional que integre espacios para guardar herramientas, superficies para realizar cortes y ajustes básicos, y una base resistente para trabajar de manera segura. Es un proyecto práctico que permite a los estudiantes aplicar sus conocimientos iniciales sobre el manejo de herramientas y carpintería.', 'Basico', '2do 2da', , 'TP 19_ Marca de un negocio.docx', 'https://www.youtube.com/embed/GptT62bnOdk?si=O4ac7Wew758K9lvB');
INSERT INTO `proyectos` (`idProyecto`, `proyectoNombre`, `descripcionProyecto`, `carrera`, `cursos`, `archivo`, `nombreArchivo`, `srcVideo`) VALUES
(36, 'Caja de Herramientas', 'Este proyecto busca que cada estudiante diseñe y construya su propia caja de herramientas básica, adaptada a sus necesidades y preferencias. Es una introducción práctica al diseño y ensamblaje, ideal para aprender el manejo de herramientas manuales.', 'Basico', '1ro 3ra', , 'Descripcion_Casos_de_Uso_Sistema_Bodega.docx', 'https://www.youtube.com/embed/GptT62bnOdk?si=O4ac7Wew758K9lvB');

